import React from 'react';
import { connect } from 'react-redux';

import Input from '../input'
import Button from '../button'
import { setDataUserName } from '../../actions';

import './login.css';

class Login extends React.Component {
  onLogin() {
    this.props.history.push('/home')
  };

  render() {
console.log('setDataUserName',setDataUserName)
    return (
      <div className="login-wrapper">
        <div className="left-content-login">
          <span className="text-login-left">Hello! Wellcome to Demo</span>
        </div>
        <div className="form-login">
          <Input
            id='user-name'
            type='text'
            placeholder='Enter Username'
            onChange={setDataUserName({})}
          />
          <Input
            id='pass-word'
            type='password'
            placeholder='Enter Password'
          />
          <Button text='Login' handleClick={() => this.onLogin()} />
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    currentDataCat: state.home.dataCat,
    currentDataDog: state.home.dataDog,
    loading: state.home.loading
  }};

const mapDispatchToProps = dispatch => {
  return {
    setDataUserName (value){
      dispatch({type: 'SET_DATA_USER_NAME', value})
    }
  }
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Login)
